import './header.css'
import NavBar from "../navbar/navbar";

interface IProps {}

const Header = ({}: IProps) => {
  return <>
    <div id="bg-superior">
        <NavBar />
        <div id="logo-banner" className=""/>
        <div id="bg-superior-inner"/>
    </div>
    </>
}

export default Header;
